In C, there are several ways to terminate a program:

1. **Return statement**: You can use the `return` statement to exit a function and terminate the program. For example:
```c
#include <stdio.h>

int main() {
    printf("Hello, world!\n");
    return 0; // terminate the program
}
```
2. **Exit function**: You can use the `exit` function from the `stdlib.h` library to terminate the program. For example:
```c
#include <stdio.h>
#include <stdlib.h>

int main() {
    printf("Hello, world!\n");
    exit(0); // terminate the program
}
```
The `exit` function takes an integer argument, which is the exit status of the program. A value of 0 typically indicates successful termination.

3. **abort function**: You can use the `abort` function from the `stdlib.h` library to terminate the program immediately, without executing any further code. For example:
```c
#include <stdio.h>
#include <stdlib.h>

int main() {
    printf("Hello, world!\n");
    abort(); // terminate the program immediately
}
```
4. **Signal handling**: You can use signal handling to terminate the program in response to a signal, such as SIGINT (interrupt) or SIGTERM (terminate). For example:
```c
#include <stdio.h>
#include <signal.h>

void sigint_handler(int sig) {
    printf("Terminating program...\n");
    exit(0);
}

int main() {
    signal(SIGINT, sigint_handler);
    printf("Hello, world!\n");
    while (1) {
        // do something
    }
}
```
In this example, the `sigint_handler` function is called when the program receives a SIGINT signal, and it terminates the program using the `exit` function.

5. **Ctrl+C**: On most systems, you can terminate a program by pressing Ctrl+C in the terminal or command prompt. This sends a SIGINT signal to the program, which can be caught and handled by the program.

Note that the `exit` function and the `abort` function are equivalent in terms of terminating the program, but `exit` allows you to specify an exit status, while `abort` does not.

